DROP TABLE [dbo].[Resultaat];
DROP TABLE [dbo].[Algorithm];
DROP TABLE [dbo].[Categorie];

CREATE TABLE [dbo].[Categorie] (
    [Id]   INT           IDENTITY (1, 1) NOT NULL,
    [Naam] VARCHAR (MAX) NOT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);

CREATE TABLE [dbo].[Algorithm] (
    [Id]                INT           IDENTITY (1, 1) NOT NULL,
    [categorieId]       INT           NOT NULL,
    [nummer]            INT           NOT NULL,
    [afbeelding]        VARCHAR (MAX) NOT NULL,
    [algorithmSolution] VARCHAR (MAX) NULL,
    [actief]            BIT           NOT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC),
    FOREIGN KEY ([categorieId]) REFERENCES [dbo].[Categorie] ([Id])
);

CREATE TABLE [dbo].[Resultaat] (
    [Id]          INT            IDENTITY (1, 1) NOT NULL,
    [Sessie]      INT            NOT NULL,
    [AlgorithmId] INT            NOT NULL,
    [Datum]       DATETIME       NOT NULL,
    [Tijd]        DECIMAL (5, 2) NOT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC),
    FOREIGN KEY ([AlgorithmId]) REFERENCES [dbo].[Algorithm] ([Id])
);

SET IDENTITY_INSERT [dbo].[Categorie] ON
SET IDENTITY_INSERT [dbo].[Categorie] OFF

SET IDENTITY_INSERT [dbo].[Algorithm] ON
SET IDENTITY_INSERT [dbo].[Algorithm] OFF

SET IDENTITY_INSERT [dbo].[Resultaat] ON
SET IDENTITY_INSERT [dbo].[Resultaat] OFF
